import { BsDot } from "react-icons/bs";
import "./Flight.css";

const data = [
  {
    id: 1,
    brand: "VietNam Airline",
    flight: "VN - 213",
    time: "21:35 - 23 - 40",
    price: "780,000",
  },
  {
    id: 2,
    brand: "VietNam Airline",
    flight: "VN - 213",
    time: "21:35 - 23 - 40",
    price: "780,000",
  },
  {
    id: 3,
    brand: "VietNam Airline",
    flight: "VN - 213",
    time: "21:35 - 23 - 40",
    price: "780,000",
  },
  {
    id: 4,
    brand: "VietNam Airline",
    flight: "VN - 213",
    time: "21:35 - 23 - 40",
    price: "780,000",
  },
];

const columns = [
  {
    title: 'Brand',
    dataIndex: 'brand',
    filters: [
      {
        text: '',
        value: 'London',
      },
      {
        text: 'New York',
        value: 'New York',
      },
    ],
    onFilter: (value, record) => record.address.indexOf(value) === 0,
  },
  {
    title: 'Age',
    dataIndex: 'age',
    sorter: (a, b) => a.age - b.age,
  },
  {
    title: 'Address',
    dataIndex: 'address',
    
  },
  {
    title: 'Action',
    key: 'action',
    sorter: true,
    render: () => (
      <Space size="middle">
        <a>Delete</a>
        <a>
          <Space>
            More actions
            <DownOutlined />
          </Space>
        </a>
      </Space>
    ),
  },
];
function Flight() {
  return <div className="wrapper"></div>;
}

export default Flight;
